export function add13(a: number, b: number): number {
  return a + b;
}

export function subtract13(a: number, b: number): number {
  return a - b;
}

export function multiply13(a: number, b: number): number {
  return a * b;
}

export function divide13(a: number, b: number): number {
  return a / b;
}
